package operators;

public class Relational {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		{
			int x = 30, y = 50, z = 80;
			System.out.println(x>y);
			System.out.println(z<y);
			System.out.println(y>=x);
			System.out.println(z<=y);
			System.out.println(y==z);
			System.out.println(y!=x);
		}

	}

}
